import React from 'react';
import logo from '../assets/logo.svg';
import '../css/App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
          <div>
              <iframe title="test_climate_co2" width="600" height="373.5"
                      src="https://app.powerbi.com/view?r=eyJrIjoiMTI4YTE5ZmEtYzdlMS00OTcyLWI3NDUtYmI3NTVlYTQ2MDc2IiwidCI6Ijg1NjAyOTA4LWUxNWItNDNiYS05MTQ4LTM4YmM3NzNhODE2ZSIsImMiOjl9"
                      frameBorder="0" allowFullScreen={true}></iframe>
          </div>
      </header>
    </div>
  );
}

export default App;
